import { ADD_FAVORITE, DE, DELETE_FAVORITELETE_FAVORITE } from "./types";

export const addFavorite = (character) => {
  return {
    type: ADD_FAVORITE,
    payload: character,
  };
};

export const removeFavorite = (id) => {
  return {
    type: DELETE_FAVORITE,
    payload: id,
  };
};
